using System;
using Domain;
using Microsoft.EntityFrameworkCore;
using System.Linq;

namespace DAL
{
    public static class DataInitializer
    {
        public static void MigrateDatabase(AppDbContext context)
        {
            context.Database.Migrate();
        }

        public static void DeleteDatabase(AppDbContext context)
        {
            context.Database.EnsureDeleted();
        }

        public static void SeedData(AppDbContext context)
        {
            var games = new[]
            {
                new Game
                {
                    Id = new Guid(),
                    Name = "nokad",
                    Image = "data:image/png;base64,",
                    MinPlayers = 4,
                    MaxPlayers = 8
                },
                new Game
                {
                    Id = new Guid(),
                    Name = "bussijuht",
                    Image = "data:image/png;base64,",
                    MinPlayers = 2,
                    MaxPlayers = 8
                },
                new Game
                {
                    Id = new Guid(),
                    Name = "hiinakas",
                    Image = "data:image/png;base64,",
                    MinPlayers = 2,
                    MaxPlayers = 6
                },
                new Game
                {
                    Id = new Guid(),
                    Name = "mastiralli",
                    Image = "data:image/png;base64,",
                    MinPlayers = 4,
                    MaxPlayers = 8
                },
                new Game
                {
                    Id = new Guid(),
                    Name = "durak",
                    Image = "data:image/png;base64,",
                    MinPlayers = 4,
                    MaxPlayers = 8
                },
                new Game
                {
                    Id = new Guid(),
                    Name = "pulk",
                    Image = "data:image/png;base64,",
                    MinPlayers = 4,
                    MaxPlayers = 8
                }
            };

            foreach (var game in games)
            {
                if (!context.Games.Any(l => l.Id == game.Id))
                {
                    context.Games.Add(game);
                }
            }

            context.SaveChanges();
        }
        
    }
}
